import{_ as e,o as t,c as n,O as a}from"./chunks/framework.9482e208.js";const f=JSON.parse('{"title":"§ 60.2-301 Clearing account; payment to credit of federal Unemployment Trust Fund.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/60.2-301.md","filePath":"vacode/60.2-301.md"}'),o={name:"vacode/60.2-301.md"},r=a('<h1 id="§-60-2-301-clearing-account-payment-to-credit-of-federal-unemployment-trust-fund" tabindex="-1">§ 60.2-301 Clearing account; payment to credit of federal Unemployment Trust Fund. <a class="header-anchor" href="#§-60-2-301-clearing-account-payment-to-credit-of-federal-unemployment-trust-fund" aria-label="Permalink to &quot;§ 60.2-301 Clearing account; payment to credit of federal Unemployment Trust Fund.&quot;">​</a></h1><p>All taxes and other moneys required by this title to be paid to the Unemployment Compensation Fund and collected by the Commission, and any interest or earnings upon any moneys or property belonging to the fund shall, promptly upon collection, be paid into the state treasury and credited to the clearing account. Any interest collected on taxes shall be paid into the Special Unemployment Compensation Administration Fund continued by § <a href="http://law.lis.virginia.gov/vacode/60.2-314/" target="_blank" rel="noreferrer">60.2-314</a>. Refunds, except for interest collected payable pursuant to § <a href="http://law.lis.virginia.gov/vacode/60.2-524/" target="_blank" rel="noreferrer">60.2-524</a>, may be paid from the clearing account. After clearance thereof, all other moneys in the clearing account, including undeliverable payments, shall immediately be paid over to the Secretary of the Treasury of the United States, to the credit of the Unemployment Trust Fund established by the Social Security Act, to be held for the Commonwealth upon the terms and conditions provided in the Social Security Act.</p><p>Code 1950, § 60-91; 1968, c. 738, § 60.1-107; 1986, c. 480; 1993, c. 249; 1995, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?951+ful+CHAP0515" target="_blank" rel="noreferrer">515</a>.</p>',3),i=[r];function c(l,d,s,p,m,u){return t(),n("div",null,i)}const y=e(o,[["render",c]]);export{f as __pageData,y as default};
